description:
                 What makes Pineapple Grapefruit eJuice by Juice Head Freeze is the quality and divine refreshment from the fresh icy ripe pineapples combined with cool juicy grapefruit mixed with menthol. This Juice Head eJuice flavor will have you in a maze tangled in rich pineapple vines as you embrace the fresh cool breeze of sweet grapefruit. You’ll wander through the excitement of juicy and sweet, but the adventure doesn’t stop there. Just down the summer field is a creamy tart fountain flowing of lush flavor that mixes perfectly with the fresh pineapples and sweet grapefruit. The exotic flavors swirled together in this divine combination has been a long-awaited burst of flavor that you’ve been craving all year long. This pair of pineapples and grapefruit is a combination of sweet and sour like never before, and this flavor by Juice Head lets you taste the reason why. Don’t keep your taste buds waiting any longer. They are just waiting to jump on the clouds filled with refinement and refreshment from the pineapple and grapefruit tart combination. So give them what they want and enjoy a 100mL bottle of Pineapple Grapefruit eJuice by Juice Head Freeze solely produced by Streamline Vape Co.PINEAPPLE GRAPEFRUIT FLAVORCALIFORNIA
PROPOSITION 65 - Warning: This product contains nicotine, a chemical known to
the state of California to cause birth defects or other reproductive harm.







